import Navbar from "../../components/Navbar/Navbar";
import styles from "./Home.module.css";
import React from "react";

const Home = () => {
  return (
    <div>
      <Navbar />
      <div className={styles.infoRectangle}>
        <div className={styles.userInfo}>
          <p>USUÁRIO</p>
          <p>NOME</p>
          <p>EMPRESA</p>
          <p>CNPJ</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
